  false,\n\t\"url\": null,\n\t\"notes\": \"Healthy Lands Initiative (HLI) Emphasis
  Area Boundaries for Idaho. Includes both the Oregon-Idaho-Nevada HLI Emphasis Area
  and the Southern Idaho-Snake River Plain HLI Emphasis Area. Overall, the Healthy
  Lands Initiative focuses on 6 emphasis areas in the West that encompass important
  sage-grouse habitat or other wildlife habitat. This is a landscape-scale approach
  to the conservation of wildlife habitat that involves multiple agencies and land
  ownerships. A special emphasis is placed on staying consistent with state wildlife
  action plans.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
